import React, { Component } from 'react'
import '../../stylesheets/FirstPage.css'
import { Button } from 'semantic-ui-react';

export default class FirstPage extends Component {
  render() {
    return (
      <div>
        <h1 id='first-title'>I LUV MOVIE</h1>
        <Button 
          id='signin-btn' >
          Sign-In  
        </Button>

        <Button
          id='signup-btn' onClick={() => this.props.history.push('/signup')}>
          Sign-Up  
        </Button>
      </div>
    )
  }
}
